import React, {useState} from 'react';
import "./App.css";
// import Components
import Form from './components/Form';
import TodoList from './components/TodoList';

function App() {
  const [inputText, setInputText] = useState("");
  const [todos, seyTodos] = useState([]);
  return (
    <div className="App">
      <header>
        <h1>Santi's Todo List</h1>
      </header>
      <Form todos={todos} seTodos={seTodos} setInputText={setInputText}/>
      <TodoList/>
    </div>
  );
}

export default App;
